// https://leetcode.com/problems/longest-substring-without-repeating-characters/description/
// Given a string s, find the length of the longest substring without repeating characters.

// Example 1:

// Input: s = "abcabcbb"
// Output: 3
// Explanation: The answer is "abc", with the length of 3.
// Example 2:

// Input: s = "bbbbb"
// Output: 1
// Explanation: The answer is "b", with the length of 1.
// Example 3:

// Input: s = "pwwkew"
// Output: 3
// Explanation: The answer is "wke", with the length of 3.
// Notice that the answer must be a substring, "pwke" is a subsequence and not a substring.

var lengthOfLongestSubstring = function (s) {
  const allSubStrings = [];
  const arr = s.split("");
  for (let k = 0; k < arr.length; k++) {
    let subStrings = [];
    for (let j = k; j < arr.length; j++) {
      if (subStrings.includes(arr[j])) {
        allSubStrings.push(subStrings);
        subStrings = [];
        subStrings.push(arr[j]);
      } else {
        subStrings.push(arr[j]);
      }
    }
    allSubStrings.push(subStrings);
  }
  if (allSubStrings.length > 0) {
    let obj = [];
    for (let j = 0; j < allSubStrings.length; j++) {
      obj[allSubStrings[j]] = allSubStrings[j].length;
    }
    return Object.entries(obj).sort((a, b) => b[1] - a[1])[0][1];
  } else return 0;
};

